<!DOCTYPE html>
<html lang="en">

<head>
  <meta charset="utf-8">
  <meta http-equiv="X-UA-Compatible" content="IE=edge">
  <meta name="viewport" content="width=device-width,initial-scale=1.0">
  <meta name="keywords" content="open source,bioinformatics community,innovation" />
  <meta name="description"
    content="A community-driven global bioinformatics innovation collaboration group. It was founded in March 2019 and consist of undergraduate, master, doctoral, and postdoctoral students from well-known universities and research institutes around the world." />
  <link rel="icon" href="<%= BASE_URL %>favicon.ico">
  <title>openbiox</title>
  <link rel="stylesheet" href="https://fonts.googleapis.com/css?family=Roboto:100,300,400,500,700,900">
  <link rel="stylesheet" href="https://fonts.googleapis.com/css?family=Material+Icons">
  <link rel="stylesheet" href="https://cdn.bootcdn.net/ajax/libs/font-awesome/5.6.1/css/all.css">
  <link rel="stylesheet" href="https://cdn.jsdelivr.net/npm/vuetify@1.x/dist/vuetify.min.css">

  <link rel="shortcut icon" href="<%= BASE_URL %>favicon.ico" type="image/x-icon">
</head>

<body>
  <noscript>
    <strong>We're sorry but SIHcPortal doesn't work properly without JavaScript enabled. Please enable it to
      continue.</strong>
  </noscript>
  <div id="app"></div>
  <!-- built files will be auto injected -->
  <% for (var i in htmlWebpackPlugin.options.cdn && htmlWebpackPlugin.options.cdn.js && htmlWebpackPlugin.options.cdn.js.preload) { %>
  <script src="<%= htmlWebpackPlugin.options.cdn.js.preload[i] %>" rel="preload"></script>
  <% } %>
  <% for (var i in htmlWebpackPlugin.options.cdn && htmlWebpackPlugin.options.cdn.js && htmlWebpackPlugin.options.cdn.js.prefetch) { %>
  <script src="<%= htmlWebpackPlugin.options.cdn.js.prefetch[i] %>" rel="prefetch"></script>
  <% } %>
</body>

</html>
